//进入游戏
message m_game_config_toc {
		repeated p_game_config  game = 1;           //0大厅1龙虎斗2红黑
}
message p_game_config {
		required int32  game_id = 1;			//游戏ID
		required int32   state = 2;				//1开0关	 
		repeated p_room  room_info = 3;         //分支信息/房间信息
}
message p_room {
		required int32   room_id = 1; 			//房间类型
		required int32   state = 2;				//1开0关
		required int32   min_limit = 3;			//准入条件	
}


//进入游戏
message m_enter_game_tos{
		optional int32  game_id = 1[default = 0];          //0大厅1龙虎2红黑百家乐
		optional int32  room = 2[default = 0];         	 //房间
		optional int32  desk = 3[default = 0];           //桌子	
}
message m_enter_game_toc{
		optional int32  game_id = 1[default = 0];           //0大厅1龙虎2红黑百家乐
		optional int32  room = 2[default = 0];         	 //普通房间就是房间ID
		optional int32  desk = 3[default = 0];           //桌子
}
message m_leave_game_tos{
		optional int32  game_id = 1[default = 0];           //0大厅1龙虎2红黑百家乐
		optional int32  room = 2[default = 0];         	 //房间
		optional int32  desk = 3[default = 0];           //桌子	
}
message m_leave_game_toc{
		optional int32  game_id = 1[default = 0];           //0大厅1龙虎2红黑百家乐
		optional int32  room = 2[default = 0];         	 //房间
		optional int32  desk = 3[default = 0];           //桌子
}

//获取牌局记录
message m_get_per_round_info_tos{
		optional int32  page = 1[default = 1];          //页数
		optional int32  num = 2[default = 10];          //条数
}
message m_get_per_round_info_toc{
		optional int32  page = 1[default = 1];          //当前页数
		repeated p_per_round_info   per_round_info = 2;			//详细信息	
}
message p_per_round_info {
		optional int32   game_id = 1[default = 1];      //1龙虎2红黑百家乐
		optional int32   room_id = 2; 					//房间类型
		optional string   per_round_number = 3;			//牌局号
		optional int64   change = 4;					//当局获利0正
		optional int32   end_time = 5;					//时间
		optional int64   win = 6;						//输赢值正负
		optional string   bets = 7;						//下注情况json格式
		optional string   result = 8;					//开奖结果json格式
}

//变换桌子 当前桌子==原来的桌子的时候 把当前桌子id 换掉
message m_change_desk_toc{
		optional int32  game_id = 1[default = 0];           //0大厅1龙虎2红黑百家乐
		optional int32  room = 2[default = 0];         	 //普通房间就是房间ID
		optional int32  old_desk = 3[default = 0];           //原来的桌子
		optional int32  new_desk = 4[default = 0];           //新的桌子
}
